#
# TABLE STRUCTURE FOR: products
#

DROP TABLE IF EXISTS `products`;

CREATE TABLE `products` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `catalog_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на каталог',
  `name_product` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название товара',
  `photo_product_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на фото товара',
  `description` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Описание товара',
  `price` decimal(19,2) NOT NULL COMMENT 'Цена товара',
  `review_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на отзыв',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name_product` (`name_product`)
) ENGINE=InnoDB AUTO_INCREMENT=151 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Товары';



